	(13, 'How to Make a Perfect Cup of Coffee at Home', 'Make a god damn Perfect Cup of Coffee at Home lets gooooooooo', 'Are you tired of spending a fortune on expensive coffee shops but still not getting the perfect cup of coffee you crave? Fear not, as we have the solution for you!\r\n\r\nMaking a perfect cup of coffee at home is easier than you think. Follow these simple steps to get that delicious coffee shop taste right in your own kitchen:\r\n\r\nStart with fresh, high-quality coffee beans.\r\nGrind the beans just before brewing to ensure maximum freshness.\r\nUse the right amount of coffee and water for your brewing method.\r\nBrew at the correct temperature and for the right amount of time.\r\nPour your coffee into a preheated mug and enjoy!\r\nBy following these steps, you\'ll be able to enjoy a perfect cup of coffee at home without breaking the bank. So why not give it a try today?', 'IMG_0123.JPG', '11', '2023-03-21 15:17:22', 'test4', 1),
